import React, {Component} from 'react';

import '../styles/navigation.css'
import '../styles/tables.css'
import {getServices} from  '../services/services' 
//import { id } from 'postcss-selector-parser';


class Services extends Component {
    constructor(){
      super()
      this.state = {
        services: '',
        links: '',
      }
      this.fetchServices = this.fetchServices.bind(this);

    }

    async fetchServices() {
        const response = await getServices(localStorage.getItem('token'));
        await this.setState({ services: response, links: ''});
        console.log(response)


      }

  render() {
      let services;

      if (this.state.services){
        services = this.state.services.map((service, i) => {
            const attributes = Object.values(service.attributes)
            return (
                <tbody key= {i}>
                <tr>
                    <td>{attributes[1]}</td>
                    <td>{attributes[2]}</td>
                    <td> ${attributes[3]}</td>
                    <td>{attributes[4]}</td>
                </tr>
                </tbody>
            ); 
        });
      }

      return (
        <div className='container'>
          <h2>Services</h2>

          <div>
          <ul className="list-group list-group-horizontal-sm">

            <li className="">
              <button className='btn btn-outline-primary' onClick={this.fetchServices}> Todos los Services</button>
              </li>
          </ul>
        </div>

          <table>
            <thead>
            <tr>
              <th>Empresa Id</th>
              <th>Nombre</th>
              <th>Salario</th>
              <th>Vacantes</th>

            </tr>
            </thead>
            {services}
          </table>
        </div>
      )
  }
}


export default Services;
